data.label:
Narrator

Suddenly, Petr approached me from behind and put his hand on my shoulder.

AddConversant(Petr Vectern); WaitForMessage(Continue);

Narrator

Lileas walked up to the podium accompanied by an old nationalist song about the Sordish Civil War, "A Leta Inta Norcni," or "The Light In the Darkness." Her eyes had a fire in them that I had never seen before.

AddConversant(Lileas Graf); WaitForMessage(Continue);

Narrator

I sat back down next to Lucian.

AddConversant(Lucian Galade); WaitForMessage(Continue);

Narrator

I sat back down next to Albin.

AddConversant(Albin Clavin); WaitForMessage(Continue);

Narrator

I sat back down next to Gloria.

AddConversant(Gloria Tory); WaitForMessage(Continue);

Narrator

The hall started applauding.

RemoveConversant(Albin Clavin); WaitForMessage(Continue);

Narrator

After some time, Lucian appeared on the stage again.

AddConversant(Lucian Galade); WaitForMessage(Continue);

Narrator

I couldn't believe it. For a moment, my sight darkened.

RemoveConversant(Albin Clavin); WaitForMessage(Continue);

